import React from 'react';
import { AppBar, Box, Toolbar } from '@mui/material';
import '.style.scss';

const Header = () => {

    return (
        <React.Fragment>
            <AppBar >
                <Toolbar>
                    <Box>HOME</Box>
                    <Box>HEHE</Box>
                    <Box>HUHU</Box>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    );
}

export default Header;
